function SupportStore(a){this.scope=a.scope,this.initToolTip(null===a||null===a.trigger||void 0===a.trigger?"click":a.trigger)}SupportStore.prototype.initToolTip=function(a){$(this.scope).find('[data-toggle="tooltip"]').tooltip({trigger:a}),$(this.scope).find('[data-toggle="tooltip"]').click(function(){var a=$(this);a.siblings('[data-toggle="tooltip"]').tooltip("hide")})};